	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; border: 1px solid rgb(0, 0, 0); width: 509px; height: 311px; background-color: rgb(19, 79, 92);\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 501px; height: 311px;\"><p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Nesten meir&nbsp;bekymringsverdig enn den synlege plastforsøplinga,&nbsp;er dei enorme mengdene&nbsp;<span>mikroplast i havet, i maten, i drikkevatnet og i lufta.</span></span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Mikroplast er&nbsp;små plastbiter på&nbsp;mindre enn 5 mm, som oppstår når plast blir brutt ned. Noreg har eit utslepp på 8 000 tonn&nbsp;mikroplast årleg,&nbsp;der mesteparten&nbsp;kjem frå bildekk,&nbsp;kunstgrasbaner, plastpellets og tekstiler.&nbsp;</span><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Vi veit foreløpig lite om&nbsp;negative effekter&nbsp;på miljø og helse.</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Klikk på personane til høgre for å sjå kva klær som sprer mikroplast. Tenk deretter gjennom&nbsp;følgjande spørsmål:</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<ul style=\"padding-left: 17px; padding-inline-start: 17px;\">\n	<li style=\"text-align: left; font-size:12pt;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Kor mykje av klærne dine inneheld&nbsp;mikroplast?</span></li>\n</ul>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size:12pt;\">Last ned <a id=\"triv702\" href=\"javascript:hyperlink702()\" style=\"cursor: pointer;\"><u><span style=\"text-decoration: underline; color:#0000FF;\">denne appen</span></u></a> for å sjekke om kosmetikk inneheld mikroplast.&nbsp;</span></p></div></div>",
